import React, { Component } from 'react'
import styled from 'styled-components'

const MAIN = styled.div`
`
const SUB1 = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: start;
    margin-bottom: 10px;
`

const SUB11 = styled.div`
    background:rgba(0, 0, 0,0.6);
    height: 40vh;
    width: 50%;
    border-radius: 10px;
`
const SUB111 = styled(SUB11)`
    margin-right: 5px;
`
const SUB112 = styled(SUB11)`
    margin-left: 5px;
`

const SUB12 = styled.div`
    background:rgba(0, 0, 0,0.6);
    height: 40vh;
    width: 100%;
    border-radius: 10px;
`

const P = styled.p`
    font-weight: bold;
    color: #fff;
    font-size: 0.75rem;
`

const TITLE = styled.div`
    opacity: 100%;
`

export default class DexData extends Component {
    render() {
        return (
            <MAIN>
                <SUB1>
                    <SUB111>
                        <TITLE>
                            <P>Pairs</P>
                        </TITLE>
                    </SUB111>
                    <SUB112></SUB112>
                </SUB1>
                <SUB1>
                    <SUB12></SUB12>
                </SUB1>
            </MAIN>
        )
    }
}
